        var options = {"configure": {"enabled": true, "filter": ["physics"]}, "nodes": {"borderWidth": 2, "borderWidthSelected": 4, "font": {"size": 7, "face": "tahoma"}}, "edges": {"color": {"inherit": true}, "font": {"size": 4, "face": "tahoma"}, "hoverWidth": 2, "shadow": {"enabled": true}, "smooth": {"type": "continuous", "forceDirection": "none"}, "width": 3}, "physics": {"forceAtlas2Based": {"gravitationalConstant": -52, "centralGravity": 0.005, "springLength": 20, "springConstant": 0.095, "damping": 1, "avoidOverlap": 0.35}, "maxVelocity": 150, "minVelocity": 0.75, "solver": "forceAtlas2Based"}};
        
        

        

        network = new vis.Network(container, data, options);

        


        

        return network;

    }

    drawGraph();
